import { connect } from "react-redux";
import AllDivButton from "../../components/allDivButton";

const mapStateToProps= (state:any) => ({
     beeingPlaying: state.beeingPlaying,
     lv : state.level
})

export default connect(mapStateToProps)(AllDivButton)
